/**
 * @param {String} source
 * @param {String} rename
 */
const serialized = (source, rename = "Blueprint") => {
    let name = source.match(/.+?Name="([^"]+)"/)[1]
    return source
        .replaceAll(/^\n|^ {12}| +$/gm, "")
        .replaceAll(
            new RegExp(
                [
                    /(?<=^Begin Object).+?(?= Name=")/,
                    /(?<=^Begin Object.*? Name="[^"]*").+/,
                    / +$/,
                    /^ +ExportedNodes=.+\n/,
                ]
                    .map(r => r.source)
                    .join("|"),
                "gm"
            ),
            ""
        )
        .replaceAll("    ", "   ")
        .replaceAll(name, rename)
}

